summary.label:
iHIIT is a straightforward interval timer with clear main display and flexible editor allowing you to program your interval training in seconds.

Features:

- Quickly create your own timers of any complexity;
- Combine rounds and intervals and nest them to any depth;
- Clear display with current interval countdown ticker and two rings for current interval and the entire timer on any device, in any orientation;
- Tap on the title or empty area to show/hide extra details;
- Switch timer mode between "timer left" and "time elapsed";
- Configurable count-in signal before next interval;
- The name of each interval is read out loud at the beginning;
- Screen is always on while timer is running;
- Check out configurable options in the app's section in Settings app.
